import { connect } from 'react-redux';
import Link from 'next/link'
import Menu from './Menu'

const headerStyle = {
  background: '#f01818'
}

const linkStyle = {
  marginRight: 15
}

const Header = ({ menu }) => {
  return (
    // <div style={headerStyle}>
    //   <Link href="/">
    //     <a style={linkStyle}>Home</a>
    //   </Link>
    //   <Link href="/about">
    //     <a style={linkStyle}>About</a>
    //   </Link>
    // </div>

    <>
      <div class="header">
        <div class="container-fluid desktop">
          <div class="row">
            <div class="col-xl-3 col-lg-4 col-md-4">
              <div class="logo">
                <Link href="/"></Link>
              </div>
            </div>

            <div class="col-xl-6 col-lg-5 col-md-5 headerBanner">
              Banner
            </div>

            <div class="col-lg-3 col-md-3">
              <div class="row">
                <div class="col">
                  <div class="search-box">
                    <input id="search" value="" placeholder="Buscar" type="text" on-keydown="_keydown" />
                    <div on-tap="_submit" class="search-icon"></div>
                  </div>
                </div>
              </div>

              <div class="row">
                <div class="col">
                  <div class="date">[[date]]</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      <div class="stripe">
        <div class="container-fluid">
          <Menu items={menu} />
        </div>
      </div>

    </>

  )
}

const mapStateToProps = state => ({
  menu: state.news.config['menu-header'],
});

export default connect(
  mapStateToProps
)(Header);
